import React from "react";
import styled from "styled-components";

import Price from "../../public/static/images/icons/price.svg";
import Reliable from "../../public/static/images/icons/reliable.svg";
// import Price from "../../public/static/images/icons/price.svg";
// import Price from "../../public/static/images/icons/price.svg";

const Yus = () => {
  return (
    <Container>
      <h3>Why Us</h3>
      <IconContainer>
        <div className="high-quality"></div>
        <div className="reliable">
          <img src={Reliable} alt="reliable" />
        </div>
        <div className="warranty"></div>
        <div className="best-price"></div>
      </IconContainer>
    </Container>
  );
};

export default Yus;

const Container = styled.div`
  height: 30vh;
  width: 100%;
  background-color: #151515;
`;
const IconContainer = styled.div`
  width: 80%;
  margin: 0 auto;
  display: grid;
  grid-template-columns: repeat(4, 1fr);
`;
